import { FETCH_CATEGORIES_SUCCESS} from "../actions/types";

const initialState = {
};

export default function(state = initialState, action) {
  switch (action.type) {
      case FETCH_CATEGORIES_SUCCESS:
        return {
            loading: false,
            categories: action.payload
        }
    default:
      return {
        ...state
          };
  }
}
